const Themes = {
    button:{
        validated: `
            background: #336600;
            color: #fff;
            border: 1px dashed #ffffff;
        `,
        error: `
            background: #990000;
            color: #fff;
            border: 1px dashed #ffffff;
        `,
        reset: `
            background-color: rgb(97, 97, 97);
            color: #fff;
        `
    }
}

export default Themes
